import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlay, faStop, faCheck, faTrash, faCarSide } from '@fortawesome/free-solid-svg-icons';


import Button from 'components/commons/Button/Button';

import styles from './CarTrack.module.scss';

function CarTrack() {

   return(
      <div className = { styles.carTrack}>
         <div className = { styles.controlBlock }>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faPlay } color = "#28a745" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faCheck } color = "#48bfeeff" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faStop } color = "#ffc107" /> }/>
            <Button style = { styles.controlBlockBtn } name = { <FontAwesomeIcon icon = { faTrash } color = "#dc3545"/> }/>
         </div>
         <CarIcon />
      </div>
   )
}
const CarIcon = (props) => (
   <svg
    xmlns="http://www.w3.org/2000/svg"
    width={400}
    height={400}
    viewBox="0 0 124 124"
    fill="none"
    {...props}
  >
    <rect width={124} height={124} rx={24} fill="#F97316" />
    <path
      d="M19.375 36.7818V100.625C19.375 102.834 21.1659 104.625 23.375 104.625H87.2181C90.7818 104.625 92.5664 100.316 90.0466 97.7966L26.2034 33.9534C23.6836 31.4336 19.375 33.2182 19.375 36.7818Z"
      fill="white"
    />
    <circle cx={63.2109} cy={37.5391} r={18.1641} fill="black" />
    <rect
      opacity={0.4}
      x={81.1328}
      y={80.7198}
      width={17.5687}
      height={17.3876}
      rx={4}
      transform="rotate(-45 81.1328 80.7198)"
      fill="#FDBA74"
    />
  </svg>
);



export default CarTrack;
